import React from "react"
class Form extends React.Component{
    render(){
        return(
            <div>
                <form>
                    <label>Username:</label>
                    <input type="text"/>
                    <br/><br/>
                    <label>Email</label>
                    <input type="email"/>
                    <br/><br/>
                    <label>Password</label>
                    <input type="password"/>
                    <br/><br/>
                    <label>confirmPassword</label>
                    <input type="password"/>
                </form>
            </div>
        )
    }
}
export default Form;
